function Intro({name, surname, link}){
    return(
        <div>
            <h1>My name is {name()}, surname - {surname}</h1>
            <a href={link}>My profile</a>
        </div>
    )
}
function App (){
    return (
        <div className="App">
            <Intro name={{firstName: "John"}} surname="Way" link="facebook.com"/>
            <Intro name={() => {return "Alex"}} surname="Steard" link="vk.com"/>
        </div>
    )
}
export default App;
